import { Auth } from "@supabase/auth-ui-react";
import { ThemeSupa } from "@supabase/auth-ui-shared";
import { supabase } from "../App";

function Login() {
  return (
    <>
      <h1
        style={{
          textAlign: "center",
          marginTop: "20px",
        }}
      >
        Welcome to LiNkUS!
      </h1>
      <Auth style
        supabaseClient={supabase}
        appearance={{ theme: ThemeSupa }}
        providers={[]}
      ></Auth>
    </>
  );
}

export default Login;
